import { useFormContext } from "react-hook-form";
import { useNavigate } from 'react-router-dom';
import { Input } from "../input";
import { Button } from "../button";


export const Step1 = ({ nextStep }: { nextStep: () => void }) => {
    const { control } = useFormContext(); // Acessa o contexto compartilhado
    const navigate = useNavigate(); 

    return (
        <div>
        <h2>Digite suas informações</h2>
        <label>Digite seu nome*</label>
        <Input
            name="nome-completo"
            control={control}
            type="text"
            placeholder="Nome Sobrenome"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <label>Digite sua data de nascimento*</label>
        <Input
            name="data-nascimento"
            control={control}
            type="date"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <label>Digite seu cpf*</label>
        <Input
            name="cpf"
            control={control}
            type="text"
            placeholder="999.999.999-99"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <label>Digite seu telefone*</label>
        <Input
            name="telefone"
            control={control}
            type="text"
            placeholder="(99) 99999-9999"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />

        <div className="container-button">
            <Button titulo="Cancelar" onClick={() => navigate('/login')} variant="secundario" />
            <Button titulo="Próximo" onClick={nextStep} />
        </div>
        </div>
    );
};



export const Step2 = ({ prevStep, nextStep }: { prevStep: () => void; nextStep: () => void }) => {
  const { control } = useFormContext(); // Acessa o mesmo contexto

  return (
    <div>
      <h2>Email e senha para login</h2>
      <label>Digite seu email*</label>
      <Input
        name="endereco"
        control={control}
        type="text"
        placeholder="Rua, Número, Bairro"
        isRequired={true}
        customStyle={{marginTop: "8px"}}
      />
      <label>Digite sua senha*</label>
      <Input
        name="cidade"
        control={control}
        type="text"
        placeholder="Digite sua cidade"
        isRequired={true}
        customStyle={{marginTop: "8px"}}
      />
      <label>Confirme sua senha*</label>
      <Input
        name="estado"
        control={control}
        type="text"
        placeholder="Digite seu estado"
        isRequired={true}
        customStyle={{marginTop: "8px"}}
      />
      <div className="container-button">
        <Button titulo="Voltar" onClick={prevStep} variant="secundario" />
        <Button titulo="Próximo" onClick={nextStep} />
      </div>
    </div>
  );
};

export const Step3 = ({ prevStep, nextStep }: { prevStep: () => void; nextStep: () => void }) => {
    const { control } = useFormContext(); // Pega o controle do FormProvider


    return (
        <div>
        <h2>Sobre seu apartamento</h2>
        <label>Qual o seu bloco?</label>
        <Input
            name="email"
            control={control}
            type="email"
            placeholder="email@exemplo.com"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <label>Qual é o n° do apartamento?</label>
        <Input
            name="email"
            control={control}
            type="email"
            placeholder="email@exemplo.com"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <div className="container-button">
            <Button titulo="Voltar" onClick={prevStep} variant="secundario" />
            <Button titulo="Próximo" onClick={nextStep} />
        </div>
        </div>
    );
};


export const Step4 = ({ prevStep }: { prevStep: () => void }) => {
    const { control } = useFormContext(); // Pega o controle do FormProvider

    return (
        <div>
        <h2>Sobre seu veículo</h2>
        <h3>Você possui um veiculo?</h3>

        <Input
            name="email"
            control={control}
            type="checkbox"
            placeholder="email@exemplo.com"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <label>Digite o modelo</label>
        <Input
            name="email"
            control={control}
            type="email"
            placeholder="email@exemplo.com"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <label>Digite a placa</label>
        <Input
            name="email"
            control={control}
            type="email"
            placeholder="email@exemplo.com"
            isRequired={true}
            customStyle={{marginTop: "8px"}}
        />
        <div className="container-button">
            <Button titulo="Voltar" onClick={prevStep} variant="secundario" />
            <Button titulo="Próximo" type="submit" />
        </div>
        </div>
    );
};
